import './App.css';
import  { BrowserRouter, Link, Routes, Route } from "react-router-dom";
import Test from "./components/Test";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
          <ul>
           <li>
             <Link to="/">Home</Link>
           </li>
         </ul>
        <Routes>
                <Route path="/test" element={<Test />} />

        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
